import React from 'react'
import './Section.css' 
function Section(){
    return(
        <>
        <div className='bgcolor'>
            <div className='dashed'></div>
        <h1 className='Text'>Build <span class="backend-text">Backend</span> task<br/>in one minutes
        </h1>
        </div>
        </>
    )
}
export default Section;
